def getConfoStamp(ns=""):
    stamp = {}

    controls = tkc.getKeyables("All", [ns])

    for control in controls:
        channels = pc.listAttr(control, shortNames=True, channelBox=True)
        
        for channel in channels[:]:
            if re.match("category\d*", channel):
                channels.remove(channel)
        
        channels.extend(pc.listAttr(control, shortNames=True, ud=False, keyable=True))

        channelsInfo = {}
        
        for channel in channels:
            attrName = control + "." + channel
            defaults = pc.attributeQuery(channel, node=control, listDefault=True)
            default = None if len(defaults) == 0 else "{0:.3f}".format(defaults[0]).replace("-0.","0.")
            value = "{0:.3f}".format(pc.getAttr(attrName)).replace("-0.","0.")
            channelsInfo[channel] = {"value":value, "default":default}

        stamp[control.split(":")[-1]] = channelsInfo

    return stamp

